import React from 'react';


const Header = () => {
  return (
    <header className="header">
      <nav className="navbar">
        <p>Get Started</p>
        <div>
          <input type='text' placeholder='Search for courses'/>
        </div>
      </nav>
    </header>
  );
}

export default Header;
